import React from 'react';
import './Header.css';

const Header = () => {
    return (
        <div className="header">
            <h1>My Website</h1>
            <nav>
                <a href="#home">Home</a>
                <a href="#about">About</a>
                <a href="#contact">Contact</a>
            </nav>
        </div>
    );
};

export default Header;
